using Domain.Entities;using Domain.Repositories;namespace Domain.UseCases;public class CabinetInteractor{    private readonly ICabinetsRepository<Cabinet> _cabinetsRepository;    public CabinetInteractor(ICabinetsRepository<Cabinet> cabinetsRepository)    {        _cabinetsRepository = cabinetsRepository;    }    public void AddCabinet(Cabinet cabinet)    {        _cabinetsRepository.Add(cabinet);    }    public void DelCabinet(Cabinet cabinet)    {        _cabinetsRepository.Delete(cabinet);    }    public List<Cabinet> GetCabinets()    {        var t = _cabinetsRepository.Read();        return t;    }}